example_input=['[({(<(())[]>[[{[]{<()<>>',
'[(()[<>])]({[<{<<[]>>(','{([(<{}[<>[]}>{[]{[(<()>','(((({<>}<{<{<>}{[]{[]{}','[[<[([]))<([[{}[[()]]]','[{[{({}]{}}([{[{{{}}([]','{<[[]]>}<{[{[{[]{()[[[]','[<(<(<(<{}))><([]([]()','<{([([[(<>()){}]>(<<{{','<{([{{}}[<[[[<>{}]]]>[]]']

def day10(arr):
  points = 0

  braces_open = 0
  braces_closed = 0
  square_bracket_open = 0
  square_bracket_closed = 0
  curly_brace_open = 0
  curly_brace_closed = 0
  angle_bracket_open = 0
  angle_bracket_closed = 0

  for i in range(0, len(arr)):
    braces_open = 0
    braces_closed = 0
    square_bracket_open = 0
    square_bracket_closed = 0
    curly_brace_open = 0
    curly_brace_closed = 0
    angle_bracket_open = 0
    angle_bracket_closed = 0
    for j in range(0, len(arr[i])):
      if arr[i][j] == '(': braces_open += 1
      if arr[i][j] == '[': square_bracket_open += 1
      if arr[i][j] == '{': curly_brace_open += 1
      if arr[i][j] == '<': angle_bracket_open += 1

      if arr[i][j] == ')': 
        braces_closed += 1         
      if arr[i][j] == ']': 
        square_bracket_closed += 1     
      if arr[i][j] == '}': 
        curly_brace_closed += 1        
      if arr[i][j] == '>': 
        angle_bracket_closed += 1

    points += abs(braces_open - braces_closed) * 3
    points += abs(square_bracket_open - square_bracket_closed) * 57
    points += abs(curly_brace_open - curly_brace_closed) * 1197
    points += abs(angle_bracket_open - angle_bracket_closed) * 25137
          
      
  print(points)

